import React from 'react';
import {Typography} from "@material-ui/core";


const AskQuestion = () => {
    const parameters = React.useState({
        title : '',
        subtitle : '',
        category : ''
    });

    this.state = {
        title : '',
        subtitle : '',
        category : ''
    }


     let handleTitle = (e) => {
       this.setState({
           title : e.target.value
       });
    }

    let handleSubtitle = (e) => {
        this.setState({
            subtitle : e.target.value
        });
    }

    let handleCategory = (e) => {
        this.setState({
            category : e.target.value
        });
    }

    console.log(parameters)

    return (
        <div>
            <Typography  >Ask a question</Typography>
            <form className="form">
                <input className="form-input" placeholder="Enter title" onChange={handleTitle} />
                <input className="form-input" placeholder="Enter question" onChange={handleSubtitle} />
                <input className="form-input" placeholder="Enter Category" onChange={handleCategory} />
            </form>
        </div>
    )
}

export default AskQuestion;
